      if (task.id == id) {
        task.complete = complete;
        task.name = name;
      }
      return task;
    });
  } else {
    return `Task with id ${id} not found`;
  }
};

export const deleteTaskById = (id, Tasks) => {
  let ids = Tasks.map((task) => task.id);
  if (ids.includes(id)) {
    return Tasks.filter((task) => task.id !== id);
  } else {
    return `Task with id ${id} not found`;
  }
};

